import React from "react";
import Data from './colleges.json'




const Card=()=> {
    return (
      <div className="App">
       
          { Data.colleges.map((post) => {

            return (
              <>
             
               <div className="card-container background ">
              <div className="iner">
               <p className="inimg">{post.rating}/5<br/>{post.rating_remarks}</p>
                       <p className="innerr">{post.tags}</p>
                       </div>
               </div>
              </>
            )
          })}
        </div>
    
    );
  }
  
export default Card
